webpackJsonp([0xc385052f5306],{467:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Solar Sailer",author:"Matthieu Oger"}},markdownRemark:{html:"<blockquote>\n<p>I'm not saying offering things for free or pay-what-you-can is wrong. I'm saying my personal feeling is that my album's not a dime. It's not a buck. I made it as well as I could, and it costs 10 bucks, or go fuck yourself.</p>\n<p>— <a href=\"http://www.spin.com/featured/trent-reznor-upward-spiral-nine-inch-nails-spin-cover-september-2013/\">Trent Reznor</a></p>\n</blockquote>\n<p>(via <a href=\"http://parislemon.com/post/59507355135/i-know-that-what-were-doing-flies-in-the-face-of\">ParisLemon</a>)</p>",frontmatter:{date:"2013-08-28",readableDate:"28 August 2013",title:"Quote — Trent Reznor",showPageTitle:null},fields:{path:"/2013/08/quote-trent-reznor/"}}},pathContext:{id:"/Users/ashen/Code/solarsailer.net/content/posts/2013-08-28-quote-trent-reznor.md absPath of file >>> MarkdownRemark"}}}});
